    let userName = getUser
    if (userName !== null) {
        return(
            <div className="navbar">
                <div className="leftSide">
                    <IconW/>
                </div>
                <div className="rightSide">
                    <Link to="/home"> Home </Link>
                    <Link to="/dashboard"> Dashboard </Link>
                    <p>Ol√°, {userName}</p>
                    <button>
                        toggleNavbar
                    </button>
                </div>
            </div>
        );
    } else {
        return(
            <div className="navbar">
                <div className="leftSide">
                    <Icon/>
                </div>
                <div className="rightSide">
                    <Link to="/register"> Registrar </Link>
                    <Link to="/login"> Login </Link>
                    <button>
                        toggleNavbar
                    </button>
                </div>
            </div>
        );
    }
}
